import React from 'react' ;
import { Modal } from 'react-bootstrap';

const ModalCheckDiploma =({ showModal, children }) => {
  return (
    showModal && (
      <Modal size="lg"
              aria-labelledby="contained-modal-title-vcenter"
              centered
      >
        <Modal.Body>
          <p className="container">
            { children }
          </p>
        </Modal.Body>
      </Modal>
    )
  )
}

 export default ModalCheckDiploma;
